SESİ ASLA DEĞİŞMEZ

Lego Star Wars Onyx Cinder 75374
Çocuklar, Onyx Cinder’ın (75374) detaylı bir LEGO® versiyonuyla kendi Star Wars: Skeleton Crew hikayelerinin kahramanı olacak. Bu koleksiyonluk LEGO Star Wars™ inşa edilebilen starship oyuncağı, iniş/kalkış veya uçuş için dönen motorlara, 2 mermi atıcısına, her biri 2 mermi atıcılı 2 dönen tarete ve kavrayan bir pençeye sahiptir. Sete dahil 5 LEGO Star Wars karakteri için koltukları (Jod LEGO minifigürü kokpitte ve Wim, Fern, KB ve Neel yolcu bölümünde), ayrıca 4 inşa edilebilen el feneri ve diğer yükler için saklama yeri bulunur. Ayrıca bir mutfak masası, yatak, meyve ve telsiz gibi aksesuarlar, yaratıcı oyunlara ilham verir. 10 yaş ve üzeri Star Wars hayranları ve Star Wars koleksiyoncuları için harika bir LEGO hediyesi fikri olan bu oyuncak araç yapım seti, adım adım talimatlar içerir. Yaratıcı deneyimi geliştiren yakınlaştıran ve döndüren dijital görüntüleme araçlarına sahip LEGO Builder uygulamasına mutlaka göz atın.;

İnşa edilebilen Star Wars: Skeleton Crew starship oyuncağı – Çocuklar, parçalarla inşa edilen bu detaylı oyuncak araçla Onyx Cinder’da kendi görevlerinin kahramanı olabilir;
5 LEGO® Star Wars™ karakteri – Vintage tarzda blasterli bir Jod LEGO minifigürü, ayrıca her biri inşa edilebilen el feneri aksesuarına sahip Wim, KB, Fern ve Neel LEGO minifigürleri;
Orijinal özellikler – Kokpit, 4 LEGO® minifigürü için koltukları olan bir bölüm, iniş/kalkış veya uçuş için dönen motorlar, 2 mermi atıcı ve her biri 2 mermi atıcılı 2 dönen taret;
Sınırsız yaratıcı oyun – Onyx Cinder ayrıca kavrayan pençeli açılan bir kargo bölümü, telsiz, meyve, korsan teleskobu ile blaster ve fenerler için bir yere sahiptir;
10 yaş ve üzeri Star Wars™ hayranları için hediye – Bu koleksiyonluk LEGO® yapım oyuncağı setini, Star Wars: Skeleton Crew’ı seven çocuklara ve Star Wars hatıraları koleksiyoncularına verin;
İnteraktif dijital yapım – LEGO® Builder uygulamasıyla çocuklar bu modeli yaparken dijital bir versiyonunu yakınlaştırabilir, döndürebilir ve görselleştirebilir;
Her yaş için eğlenceli LEGO® Star Wars™ setleri – LEGO Star Wars yapım oyuncaklarıyla çocuklar ve yetişkin hayranlar simgeleşmiş sahneleri canlandırabilir, kendi yaratıcı hikayelerini hayal edebilir ya da inşa edilebilen modelleri sergileyebilir;
İnşa edin, oynayın ve sergileyin – Parçalarla inşa edilen bu Star Wars™ araç oyuncağının yüksekliği 11 cm, uzunluğu 36 cm, genişliği 27 cm’dir;
